	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 661px; min-height: 381px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 651px; min-height: 371px;\"><p style=\"text-align: start; margin-bottom: 0px; margin-top: 0px; line-height: 1.5;\"><span style=\"font-size:14pt; color: black; font-family: Arial, sans-serif;\">Metan, lystgass og&nbsp;CO<sub>2&nbsp;</sub>er klimagasser fra landbruket. Utslippene av disse gassene er mye høyere for animalske produkter enn for vegetabilske. Nesten 9% av de totale klimagassutslippene i Norge kommer fra landbruket, og av dette kommer ca. 90% fra husdyrproduksjon, dyrking av fôr og utslipp fra drøvtyggeres fordøyelse (klikk på bien og se selv). Drøvtyggere som storfe og sau lager metan i fordøyelsessystemet sitt, og denne klimagassen har 25 ganger så stor klimapåvirkning i atmosfæren enn&nbsp;CO<sub>2</sub>.</span></p>\n\n<p style=\"text-align: start; margin-bottom: 0px; margin-top: 0px; line-height: 1.5;\"><span style=\"font-size:14pt; color: black; font-family: -webkit-standard, sans-serif;\">​</span></p>\n\n<p style=\"text-align: start; margin-bottom: 0px; margin-top: 0px; line-height: 1.5;\"><span style=\"font-size:14pt; color: black; font-family: Arial, sans-serif;\">Kraftfôret til norske storfe, gris, kylling og oppdrettsfisk inneholder betydelige mengder soya importert fra Brasil. Dyrking av soya tar store landområder, og globalt bidrar verdens økende kjøttforbruk sterkt til avskoging blant annet i Amazonas. Avskoging igjen fører til artsutryddelse, klimagassutslipp samt redusert opptak av&nbsp;CO<sub>2</sub>.</span></p></div></div>",
